import Profile from '../components/Profile';
import user from '../components/user.json';
import statsData from '../components/';

function App() {
  return (
    <div>
      <Profile
        username={user.username}
        tag={user.tag}
        location={user.location}
        avatar={user.avatar}
        stats={user.stats}
      />
      <Statistics title="File types" stats={statsData} />
    </div>
  );
}

export default App;
